import styled from 'styled-components'

export const IneerBoxContainer = styled.div`
  margin-top: 24px;
  margin-left: 36px;
  width: calc(100% - 72px);
  min-width: 884px;
  background: #ffffff;
  box-shadow: 0px 0px 24px rgba(0, 0, 0, 0.16);
  border-radius: 24px;
  flex: none;
  order: 1;
  flex-grow: 0;
`
